import React,{Component} from 'react';
import './App.css';

class App extends Component {
  constructor(props) {
    super(props);
    this.state = { 

		user : "",
		password : ""
	}
}

  render() { 
    return ( <div className="div1">

		<div style={{color : "violet"}}><h1>Login</h1></div>

		<br/><br/>

      <div>

        <div style={{display:"flex",justifyContent : "center"}}>

			<img src="data:image/png;base64," alt="img"/>

        </div>
        <br/><br/>
        <input type="text" value={this.state.user} onChange={e=>{this.setState({user : e.target.value})}}/>
        <br/><br/>
        <input type="password" value={this.state.password} onChange={e=>{this.setState({password : e.target.value})}}/>
        <br/><br/>
        &emsp;&emsp;&emsp;&emsp;&emsp;&emsp;&emsp;
        <button onClick={()=>this.setState({user : "",password : ""})}>done</button>

      </div>

    </div> );
  }
}

export default App;
